window.bookSummaryJSON = "<p><b>Locus Awards - Nominee - 2021</b></p> <p><b>\"Heath Miller smoothly narrates this young adult fantasy.... [He] ensures that listeners of all ages will thoroughly enjoy this audio experience.\" (</b><b><i>AudioFile Magazine)</i></b></p> <p>Writing as A. Deborah Baker, <i>New York Times</i> best-selling and award-winning author Seanan McGuire introduces listeners to a world of talking trees and sarcastic owls, of dangerous mermaids and captivating queens in <i>Over the Woodward Wall</i>, an exceptional tale for listeners who are young at heart.</p> <p>If you trust her youâ€™ll never make it home....</p> <p>Avery is an exceptional child. Everything he does is precise, from the way he washes his face in the morning, to the way he completes his homework - without complaint, without fuss, without prompt.</p> <p>Zib is also an exceptional child, because all children are, in their own way. But where everything Avery does and is can be measured, nothing Zib does can possibly be predicted, except for the fact that she can always be relied upon to be unpredictable.</p> <p>They live on the same street.</p> <p>They live in different worlds.</p> <p>On an unplanned detour from home to school one morning, Avery and Zib find themselves climbing over a stone wall into the Up and Under - an impossible land filled with mystery, adventure, and the strangest creatures.</p> <p>And they must find themselves and each other if they are to also find their way out and back to their own lives.&nbsp;</p> <p><b>A Macmillan Audio production from Tor.com&nbsp;</b></p>"; 
